import React from 'react';
import goodsStyles from '../components';

function Goods() {
  return (
    <main>
      <ul className={`${goodsStyles['card-set']} ${goodsStyles.list}`}>
        <li className={`${goodsStyles['card-set__item']}`}>
          <a href="" className={`${goodsStyles['card-set__link']} ${goodsStyles.link}`}>
            <div className={`${goodsStyles.card}`}>
              <img src="./src/components/img/goods.png" alt="" />
            </div>
          </a>
        </li>

        <li className={`${goodsStyles['card-set__item']}`}>
          <a href="" className={`${goodsStyles['card-set__link']} ${goodsStyles.link}`}>
            <div className={`${goodsStyles.card}`}>
              <img src="./src/components/img/goods.png" alt="" />
            </div>
          </a>
        </li>

        {/* Решта коду для карточок товарів */}
      </ul>
    </main>
  );
}

export default Goods;
